import { Route, Routes } from "react-router-dom";
import App from "../App";


function Routing(): JSX.Element {
    return (
        <div className="Routing">
			<Routes>
                // client routes // 
                <Route path="/" element={<App/>}/>
                <Route index element={<App/>}/>
            </Routes>
        </div>
    );
}

export default Routing;
